    "text": "I had really high expectations for this bakery since I'm a pastry chef myself. They seem like they are going for more of a wholesale bakery rather than retail since the show case was rather sad. We arrived at 10:45 on Sunday but there was no sign of life. We thought they were closed but we asked a chef who was just arriving to work and he said they opened at 11.....kind of odd for a bakery. We had the blueberry hand pie. It was good but probably not worth $6.50.  No espresso drinks but they had drip coffee. We will come back again in the future when they aren't so new.",
