    "text": "A friend recommended this place for breakfast.  The place is a multi use venue with food served all day and the addition of a wine bar in the evening.  Order up at the counter, get a seat, and wait for your food.  Seating is communal but their is plenty of space so in the morning everyone was spread out.  I had the green eggs and ham and it was really good.  Definitely worth it. \n\nPlace can get busy so come early.  They offer self serve water but needed to fill it up more often.  Lines for the bathroom could get long as they were single use only.",
