    "review_stars": 4,
    "text": "We came here for a late lunch while wine tasting/exploring the funk zone.  It is located inside the Santa Barbara wine collective and we were lucky enough to grab a table and some wine as well.  \n\nThey had lots of options on their menu, however since we were there a little later in the day they were out of most of their sandwiches.  I got the turkey sandwich which was absolutely amazing, I loved every bite of it.  My friend is a vegetarian and unfortunately the only sandwiches they had left all had meat in them.  She opted for the chickpea salad and was not very impressed.\n\nThey're a bit pricey, but most of the other places don't serve food so they can get away with it.  I'd definitely recommend stopping by earlier in the day so there are more options available especially if you are with picky eaters.",
