    "review_stars": 5,
    "text": "The biscuits, the bread, the gluten, the gluten free all unbelievably good. The Simpsons donut was amazing with a raspberry glaze that will make you swoon. I can barely type about the green harissa eggs and ham breakfast  biscuit.  I just got back from Texas and searching for the best biscuits was kind of my thing, dang it if the best biscuits I've had in my life are here in SB at Helena (sorry grandma). There is some green harissa and crumbs left on my plate and I am trying to decide if licking my plate at this place would be uncouth. Best breakfast sandwich in SB hands down.  Had their lunch sandwiches before and they are also exceptional.",
