    "review_stars": 3,
    "text": "We came for lunch - a cute place and a bit of variety with what else is around, but nothing special.  I had the market salad and my husband had the hot chicken sandwich.  We also got a lemon blueberry scone to share.  The scone was good, on the sweeter side.  The hot chicken sandwich was decent, but not our favorite of various sandwich places around.  My market salad was incredibly disappointing - only had radish and pickled celery in it for $13.  Seems like it may be better for breakfast or just drinks or bakery items.\n\nThe one really nice thing was we had our toddler with us and they brought us out some chicken for her for free since they didn't want her to eat the spicy chicken my husband had.  We had to ask two people who worked there for help with a highchair though - they have them, but in the backroom.  So, a mix of being child friendly!",
