    "text": "Having a breakfast sandwich from here is a complete meal that will last you until lunch.  We ordered the Egg and Cheese Biscuit with bacon and my daughter ordered the same but gluten free.  The biscuit sandwich was two handfuls of total yummy flavors.  Fresh biscuit with egg covered in a maple glaze and layered with bacon \"my my my\" it was amazing.  It wasn't very busy at the time but before we left customers were lined up waiting to place their orders.  \n\nThe restaurant had plenty of indoor and outdoor seating (the seating is a shared space with the winery next door all under one roof) this was a great start to my day.\nWhile you wait for your order you can watch all the bakers and kitchen staff preparing the food from behind the glass walls of the restaurant.",
