    "user_id": "Uxpe-wkMqxIFAGJLkvWVHA",
    "review_stars": 5,
    "text": "One of my favoriteeee places in Santa Barbara. It is definitely a hidden gem south of State street in the Funk Zone but I love the architecture and love that it is also a wine bar inside! The patio is great on warm days. I ordered a mocha and the cuban sandwich on my last trip here and both were delicious. The mocha was huge, which I love and they both came out quickly. You do have to get your own water/utensils/napkins which can be a little annoying, but they are located right next to the front door. It would be fun to sit inside and watch them bake on one of my future trips and I have yet to try the wine bar. They have a great selection of food, drinks and the pastries look delicious and are huge! That is also on my list for next time. \n\nParking is a pain, so just know on busier days it might be harder to get there.",
