    "review_stars": 4,
    "text": "Thank goodness for Yelp reviews.  We take the 101 many times from SoCal to the Bay Area and are always looking for a place to stop for breakfast.  This was a perfect choice for us.  The restaurant has both indoor and outdoor seating and the decor looks industrial/funky.  They have some nice breakfast options and we enjoyed our choices.  The only problem was that they took a very long time to deliver our meals and when my eggs arrived they were not hot.  I sent them back and kept an eye on the kitchen.  I had to go up to the cashier to ask if the eggs that were sitting on the counter in the kitchen were mine.  Yes they were and fortunately I saw them in time to enjoy them at the right temperature.  It may have been a bad day for the servers and we will definitely try it again.",
