    "review_stars": 3,
    "text": "We found this place to be fairly disappointing. Maybe we just ordered the wrong stuff? There were several different breakfast sandwiches on the menu. We were looking for just a quick bit. Simple pastries, donuts etc. The place calls itself a bakery, so I assumed the croissants, pastries, and donuts would be very fresh. This was not the case. I had a ham & cheese croissant, which was ok, but not that fresh, flakey etc. My daughter ordered the \"seasonal donut\" which was $4.00. It was just an iced cake donut with colored sprinkles. Nothing more than you'd find at a cheap donut place for $1.00 or less. My wife had a blueberry danish. Again, it was OK, but not great. This place says it is a bakery. Am I wrong for assuming the baked goods would be fresh and better than average? If you're going to charge me $4.00 for a donut, it better be the best darn donut I ever ate. Next time we're in town, we'll try somewhere else.",
