    "text": "This place was recommended by a foodie blogger. Didn't think much of it before until I tried it. Their house made buttermilk biscuit is so good and salty. The bacon is really good on it as well as the fried egg. I came here twice on my 2 day trip in Santa Barbra. I couldn't imagine having a different lunch besides the great buttermilk biscuit that I won't be able to have until my next trip. Also the red Pap dish is really great. My friend ordered this dish and the pastries are perfectly crispy. Completely inspired me to try to make them at home. Also, everything was perfectly salted, highly appreciated that. I will definitely be back for more. Until then, I'll currently fantasize about the oatmeal raisin cookie I bought to take home. Can't wait to get out of work and have some",
