    "review_stars": 5,
    "text": "Expensive and LA hipster?  If you like greasy spoon places on the cheap-motel strip- this is not for you.  Everything in California is expensive and this place is no different.  You pay for quality of ingredients, preparation, and setting.  If you like Dennys- heavily advertising on Yelp! or oversized heavy food - again don't go. \n\nCappuccino was really good. \nFrench toast is not French toast but pound cake topped with fruit. Avocado toast is great - bread needs steak knife unless you  just bite. ( real bread not wonder(what it is) bread.)\n\nIn SB for the weekend - go.\n\nFor the second day we chose a beach cafe, sat down, got up and went back here.  Guess why.",
