    "text": "The baked goods that we ordered were absolutely delicious and I can be pretty critical about baked goods...I expect a lot for that many Calories!   Chocolate croissant... just the right amount of chocolate plus tender yet crispy and soft... wonderful flavor.  Chocolate Chip cookie... chocolatey and good texture and flavor.   Bacon, egg and cheese sandwich... wonderful combo with arugula.  It came on a tender biscuit... flavors came together very well.   Quiche... big serving and good flavor.  The only reason for 4 stars instead of 5 is because we could see right into the kitchen (good thing)  and saw the employees using their phones to text and drinking coffee while prepping food (very bad hygiene.)  I can't believe that was happening actually.",
