    "review_stars": 5,
    "text": "Once again does not disappoint! Came here over a year ago and couldn't forget how delicious it was especially the peanut cashew butter! Stopped by on our way north and feasted again on such flavorful unique dishes even the simplest Ricotta Toast is flavorful and filling! Freshest ingredients generous portions served in a relaxed atmosphere where you can hear yourselves talk is the recipe for a perfect spot to treat yourself on Santa Barbara. For the kids you can order house-made bagel toasted with peanut cashew butter or jam and there are board games for all to play.\nToday's sampling was \nCalifornia Turkey Sandwich with Cheddar big enough for two \nGreen Breakfast Bowl totally unique but so tasty and filling",
