    "review_stars": 5,
    "text": "What a lovely bakery in such a fun part of SB!\nThe gal recommended the savory tomato tart, omggg if they have it, get it! The perfect pastry with a layer of cheese, tomatoes, basil and almost ljke everything bagel seasoning around lol. Basically a lighter mini breakfast pizza. Need more ASAP. The avocado toast was also delicious, thick rustic sourdough with avo, sprouts, feta and cucumbers. Got an oat latte which was good, the drip coffee was a little lukewarm and a tad acidic but overall had a good experience and would def recommend!",
