    "user_id": "2dRbjSC90LB0hX1XvkzwfQ",
    "review_stars": 5,
    "text": "Wow! This is one of those rare places where every single thing I tried was outstanding. My wife and I ordered a few coffees, a few breakfast sandwiches, and a pastry. Each one of these items stood out in its own way. The cinnamon roll was impossibly gooey and had a surprising dash of salt that really intensified its cinnamony flavor. The breakfast sandwiches blended a number of different flavors that complemented one another well. The chicken sandwich was buttery at the same time it was peppery, and sweet while it was salty. For breakfast on the go, this has got to be one of the best places in Santa Barbara.",
    "date": "2021-01-16 18:34:22"
