    "text": "This is a great place to get a bit of breakfast and coffee. The bakery has both indoor and outdoor garden seating. Nice atmosphere. Cheerful employees. \n\nWe got a cinnamon roll and the chicken sandwich to share for breakfast, along with a couple of lattes. The cinnamon roll was massive - great for sharing. Lots of good cinnamon. The chicken sandwich comes on a brioche bun, with bacon and a sweet and spicy jam. The chicken is perfectly cooked, crispy and savory outside and juicy inside. I would definitely recommend making this a place to get breakfast while in Santa Barbara.",
