    "review_stars": 1,
    "text": "This charming location is breakfast lunch only. The open air courtyard style location is shared with another business. I walked towards the counter to look at the breakfast menu sometime after 2. There was a large sign that said it was closed but I just wanted to look to see what type of baked goods they may have for tomorrow morning. The young person behind the counter was sweeping, didn't look up, and with a kinda irritated tone declares they were closed. I said  I saw the sign but was looking for tomorrow. She tells me \"you'd be surprised how many people don't read the sign\" with yet another dose of attitude and still not even looking at me. \nSo I say well ya know, where I come from, people are greeted when spoken to. She finally looks up and says she did t appreciate my sarcasm. I told her it was more of a life skill I was sharing but ok. Needless to say, I will not be visiting this adorable bakery for breakfast tomorrow. Mostly because I didn't see any baked goods anywhere and I didnt want to ask. Bummer",
