    "review_stars": 5,
    "text": "Stopped by based off of Yelp reviews on our trip up the coast.  Our GPS took us to the address, which is kind of the back of the building.  You won't see the bakery from here, it is the parking lot.  The bakery is kind of in a shared building and you actually enter from the other side.  \nI had the green eggs and ham biscuit which was very good, I loved the the very thinly sliced ham.  My wife had the avocado toast with the egg on top and she loved it too.  Pretty busy place.  Good stuff.  Nice job guys.",
