    "review_stars": 2,
    "text": "i went on a sunday morning around 9:45 and waited 30 minutes to order. the staff does not mask or wear PPE and there is no social distancing. the utensils were left on the side of the restaurant for customers to get themselves. pretty much ZERO COVID SAFETY PRECAUTIONS. the food is a bit overpriced for what it is. we ordered 1 mild fried chicken sandwich on brioche, 1 breakfast sandwich on a buttermilk biscuit, and 1 side order of crispy potatoes with chipotle ketchup for ~$33 before tip. i highly recommend the chicken sandwich!!! crispy with the perfect amount of jalapeo jam to balance it out. the breakfast sandwich came with a large brick of egg that i personally was not a fan of. it was too big that you could hardly eat it as a sandwich. we ended up deconstructing it and eating the biscuit with a side of their heavenly blueberry jam. the potatoes were nice and crispy but nothing outstanding about it. \n\nbest thing about this place: fried chicken sandwich \nworst thing about this place: no health precautions",
