    "user_id": "Me67xciZwEpObhhQcPLDUg",
    "review_stars": 2,
    "text": "Helena Bakery is on a decline. Their pastries have become soft and dense, their breakfast plates inconsistent, and they have unforgivably decided to store their, what would otherwise be excellent, sandwiches in the refrigerator - effectively destroying the freshness of their hand made bread. Overall their food has lost balance and focus. I suspect this is becoming an upscale tourist trap. It has location and design but has lost a significant portion of its substance. Step it back up Helena. You're slipping!",
    "date": "2018-07-26 16:48:24"
