    "user_id": "PvpabHP_uxTwUC1n96JiMQ",
    "review_stars": 5,
    "text": "We needed a quick bite before meeting up with friends, and Helena was walking distance from our Waterman Hotel.  My Americano was a great pick me up, hot and smooth.  I got the biscuit with lavender jam and butter.  The butter and jam taste a bit sour and unfortunately the biscuit was cold and dry. I did not know this til we were eating it down at the beach.  \n\nBut - the life saver was definitely the breakfast sandwich in a soft brioche bun.  It has the thickest and fluffiest baked egg in the middle with \na big slice of bacon. It was simply delicious! They also had a other pastries and sandwiches we wanted to try however just not enough time to come back with our friends' weekend destination wedding.  But to our happy surprise the newly bride and groom catered from Helena for our weekend farewell brunch. We got to try everything else and more!  The chicken sandwich, the Elvis style banana bread, the avocado toast, and the cinnamon roll. The cinnamon rolls was bit thick and dense, but everything else was delicious! Whoa, a breakfast at Helen's will keep your stomach very happy for sure!",
