    "review_stars": 5,
    "text": "Super cute bakery and breakfast spot in the funk town district of SB. They have a super open indoor area as well as a great patio area with outdoor seating. Their pastries all looked amazing but we went with the blueberry lemon scone (cinnamon roll was a close contender) to start and it was up there with the best scones I've ever had. There were actual blueberries inside and it was fluffy with a hard outside, 5/5. For our meals I got the yogurt bowl with blueberries and their homemade granola which I was a huge fan of! It was also a pretty hearty bowl so was filling. My friend got the avocado toast which was also delicious, fluffy bread with feta cheese and a good portion of avocado. Overall, great ambiance and loved all the food we tried!",
